#!/bin/bash

QUERIES=("abcd")
INPUTS=("abcd" "aabbccdd" "aaaabbbbccccdddd" "aaaaaaaabbbbbbbbccccccccdddddddd" "aaaaaaaaaaaaaaaabbbbbbbbbbbbbbbbccccccccccccccccdddddddddddddddd" "aaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaabbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbccccccccccccccccccccccccccccccccdddddddddddddddddddddddddddddddd" "aaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaaabbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbbccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccccdddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddddd" "" "" "" "" "" "")
SUMMARY_SIZES=(20000) 
TIME_WINDOW_SIZES=(20000) 
STREAM_SIZES=(100000)
TIMES_TO_LIVE=(100000)
PROB_DISTRIBUTIONS=("zipf")
EVAL_TIMESTAMPS_COUNTS=(1)
EVAL_TIMESTAMPS_PROB_DISTS=("uniform")
NUM_OF_RUNS=(1)

rm report.csv
rm -f seeds.txt

for query in "${QUERIES[@]}"
do
	for time_window_size in "${TIME_WINDOW_SIZES[@]}"
	do
		for summary_size in "${SUMMARY_SIZES[@]}"
		do
			for stream_size in "${STREAM_SIZES[@]}"
			do
				for time_to_live in "${TIMES_TO_LIVE[@]}"
				do
					for prob_distribution in "${PROB_DISTRIBUTIONS[@]}"
					do
						for eval_timestamp_count in "${EVAL_TIMESTAMPS_COUNTS[@]}"
						do
							for eval_timestamp_dist in "${EVAL_TIMESTAMPS_PROB_DISTS[@]}"
							do
								for input in "${INPUTS[@]}"
								do
									for ((run=1; run<=NUM_OF_RUNS; run++))
									do
										bash run_test.sh \
											${summary_size} \
											${time_window_size} \
											${#input} \
											${time_to_live} \
											${prob_distribution} \
											${eval_timestamp_count} \
											${eval_timestamp_dist} \
											${RANDOM} \
											${query} \
											${input} >/dev/null &
									done
								done
							done
						done
						wait
					done
				done
			done
		done
	done
done

head -c -1 seeds.txt > temp.txt && mv temp.txt seeds.txt
echo -n ")" >> seeds.txt

wait

rm *.probs
